function Scores()
{

  const [teams, setTeams] = useState([]);


  useEffect(() => {
    const url = "/results";

    const fetchData = async () => {
      try
      {
        const response = await fetch(url);
        const data = await response.json();

        //setTeams(data);

        console.log("results:",data);
      }
      catch (error)
      {
        console.log("error", error);
      }
    };

    fetchData();
  }, []);


  return (
    <div id="Body">

    </div>
  );
}

export default Scores;
